stationDescription:
Эфир нашего радио состоит из:
- лучших песен музыкантов и музыкальных коллективов, которые когда-либо рассматривались, рассматриваются в даный момент, либо будут рассматриваться в недалёком будущем в наших передачах;
- новинок музыкальной рок-индустрии;
- замечательных рок-хитов, уже успевших стать классикой;
- достойных композиций с пост-советской рок-сцены;
- небольших отделений классической/инструментальной музыки.
Подробности на нашем сайте: rock-omlet.com
